import {useSelector} from 'react-redux'

export const Counter = () => {

    const { counter } = useSelector(({ counter }) => (counter))
    const dispatch = useDispatch()

    return (
        <div>
            Counter - {counter}
            <button onClick={() => dispatch(incCounter())}>INC</button>
        </div>
    )
}
